import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      users : []
    }
  }

  componentDidMount(){
      fetch('http://localhost:8080/users')
        .then(res => res.json())
        .then(json => {
            this.setState({
              users : json
            })
        });
  }

  render(){

    var {users} = this.state;
    return(
      <div className ="App">
        <ul>
          {users.map(user => (
            <li key={user.userId}>
              {user.userName}
            </li>
          ))};
        </ul>
      </div>
    )
  }
}
export default App;
